export default function Perfil() {
    const [details, setDetails] = useState(true);
    const [alunos, setAlunos] = useState(false);

    return (
        <Box>
            <Tabs isToggle>
                <TabList>
                    <Tab isActive={details}>
                        <TabLink>Detalhes</TabLink>
                    </Tab>
                    <Tab isActive={alunos}>
                        <TabLink>Alunos</TabLink>
                    </Tab>
                </TabList>
            </Tabs>
            <Section>

            </Section>
        </Box>
    )
}
